void int2char(int num, unsigned char str[])
{
char lstr[30];
int cnt = 0;
int div = 10;
int j = 0;

	
	
while( num >= div)
{
	lstr[cnt] = num % div + 0x30;
	num /= 10;
	cnt++;
}
	lstr[cnt] = num + 0x30;
for(j= cnt ; j >=0;j--)
{
	str[cnt-j] = lstr[j];
}

}


